import React from "react";
import { useNavigate } from "react-router-dom";

export default function LoginSelection() {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-900 text-white p-6">
      <h1 className="text-4xl font-bold mb-6 text-center">Welcome to News Aggregator</h1>
      <p className="text-lg mb-6 text-center max-w-xl">
        Stay informed with the latest updates from around the world. Get personalized news tailored to your interests and access admin features for managing content.
      </p>
      <div className="flex gap-4">
        <button 
          onClick={() => navigate("/user-main")} 
          className="px-6 py-3 bg-blue-600 hover:bg-blue-700 text-white font-semibold rounded-md shadow-md transition duration-300">
          User Login
        </button>
        <button 
          onClick={() => navigate("/app")} 
          className="px-6 py-3 bg-green-600 hover:bg-green-700 text-white font-semibold rounded-md shadow-md transition duration-300">
          Admin Login
        </button>
      </div>
    </div>
  );
}
